export default function reducer(
  state = {
    isLoginSuccess: false,
    isLoginPending: false,
    loginError: null
  },
  action
) {
  if (action.type === "TRUE") {
    return Object.assign({}, state, {
      status: action.payload
    });
  }
  if (action.type === "FALSE") {
    return Object.assign({}, state, {
      status: "wrong"
    });
  }
  return state;
}
